					this.value.push(new node(nam, coordinatex, coordinatey, predict_value, father_node,g_value));

				    bubbleup(){
					let idx = this.value.length-1;
					let parents_idx = Math.floor((idx-1) / 2);
					const {value} = this;
					while (value[parents_idx]?.predict_value > value[idx].predict_value ){

					}

					while(tmp < this.value.length){
					    let leftChildIdx = tmp * 2 + 1;
					    let rightChildIdx = tmp * 2 + 2;
					    if (
						(rightChildIdx < this.value.length &&
						  this.value[rightChildIdx].predict_value <
						    this.value[leftChildIdx].predict_value) 
					      )

					    }

					    }

					    if(this.value[swapid].predict_value < this.value[tmp].predict_value ){
						[this.value[swapid] , this.value[tmp]] = [this.value[tmp] , this.value[swapid]];
						tmp = swapid;
					    }
					    else break;
					}

				    }

				    var openlist = new prior_queue();
				    function dis(a,b){
					 var x_first = a.coordinatex;
					 var x_sec = b.coordinatex;
					 var y_first = a.coordinatey;
					 var y_sec = b.coordinatey;
					 return Math.sqrt((x_sec - x_first) ** 2 + (y_sec - y_first) ** 2);

				    }
				    function Recursion(end_node){
					if (openlist.value.length != 0){
					    var temp = openlist.dequeue();
					    var sig = 0;
					    for(let i = 0 ; i < matrix[temp].length ; i++){
						if(matrix[temp][i] !=0  &&  i == end_node){
						    sequence[i].father_node = temp;
						    sig = 1; 
						    break;
						}
						else if(matrix[temp][i] != 0 &&  sequence[i].father_node == -1){
						    sequence[i].father_node = temp;
						    sequence[i].g_value = dis(sequence[temp]  , sequence[i]) + sequence[temp].g_value;//g(n)
						    var goofn = dis(sequence[i] , sequence[end_node]);
						    sequence[i].predict_value = sequence[i].g_value + goofn;
						    openlist.enqueue(sequence[i].nam,sequence[i].coordinatex,sequence[i].coordinatey,sequence[i].predict_value,sequence[i].father_node,sequence[i].g_value);
						}
						else if(matrix[temp][i] != 0 &&  sequence[i].father_node !== -1 && sequence[temp].father_node != -1 && sequence[temp].father_node > 0){
						    let googn = dis(sequence[temp]  , sequence[i]) + sequence[temp].g_value;
						    let goofn = dis(sequence[i] , sequence[end_node]);
						    var temp_fn = goofn + googn;
						    if(sequence[i].g_value > googn){
							sequence[i].predict_value = temp_fn;
							sequence[i].g_value = googn;
							sequence[i].father_node = temp;
							openlist.enqueue(sequence[i].nam,sequence[i].coordinatex,sequence[i].coordinatey,sequence[i].predict_value,sequence[i].father_node,sequence[i].g_value);
						    }
						}
					    }
					}
					else console.log("openlsit is empty");
					if(openlist.value.length != 0 && sig == 0)Recursion(end_node);
				    }
				    let arr = [];
				    function a_star(start_node , end_node){
					    start_node--;
					    end_node--;
					    console.log("end_node = "+end_node+"start_node = "+start_node);
					while(arr.length !=0){
					    arr.pop();
					}
					while(openlist.value.length != 0)openlist.value.pop();
					for(let i = 0; i < sequence.length; i++){
					    sequence[i].predict_value = 0;
					    sequence[i].g_value = 0;
					    sequence[i].father_node = -1;
					}
					sequence[start_node].father_node = -5;
					sequence[start_node].g_value = 0;
					openlist.enqueue(start_node,sequence[start_node].coordinatex,sequence[start_node].coordinatey,sequence[start_node].predict_value,sequence[start_node].father_node,sequence[start_node].g_value);
					Recursion(end_node);
					var temp = end_node;
				       while (sequence[temp].father_node != -5){
					    arr.push(temp);
					    temp = sequence[temp].father_node;
					}
					arr.push(start_node);
					console.log("hi arr length = "+arr.length);
					for(let i=0;i<arr.length;i++){
						console.log(arr[i]);
					}
		                ctx.beginPath();
				ctx.moveTo(sequence[arr[0]].coordinatex,sequence[arr[0]].coordinatey);
				for(let i=1;i<arr.length;i++){
					console.log(arr[i]);
					ctx.lineTo(sequence[arr[i]].coordinatex,sequence[arr[i]].coordinatey);
				    }
						ctx.stroke();
				    }
				    a_star(Number(locationValue), Number(destinationValue));
